import { useState, useEffect } from "react";
import { Nav, Navbar, Button, NavItem } from "react-bootstrap";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";

import "./App.css";
import AboutUs from "./components/AboutUs";
import Home from "./components/Home";
import Login from "./components/Login";
import OurVision from "./components/OurVision";

const App = () => {
  const [placeholder, setPlaceholder] = useState("Hi");

  useEffect(() => {
    fetch("/hello")
      .then((res) => res.json())
      .then((data) => {
        console.log("data", data);
        setPlaceholder(data);
        // setPlaceholder(data.result);
      });
  }, []);

  return (
    <div className="main">
      <div>
        <Navbar className="colorNav">
          <Navbar.Brand as={Link} to="/">
            JMEET
          </Navbar.Brand>
          <Navbar.Collapse>
            <Nav className="mr-auto">
              <NavItem eventkey={1} href="/">
                <Nav.Link as={Link} to="/">
                  Home
                </Nav.Link>
              </NavItem>
              <NavItem eventkey={2} href="/about-us">
                <Nav.Link as={Link} to="/about-us">
                  About Us
                </Nav.Link>
              </NavItem>
              <NavItem eventkey={3} href="/our-vision">
                <Nav.Link as={Link} to="/our-vision">
                  Our Vision
                </Nav.Link>
              </NavItem>
              <NavItem eventkey={4} href="/login">
                <Nav.Link as={Link} to="/login">
                  Login
                </Nav.Link>
              </NavItem>
            </Nav>
          </Navbar.Collapse>
          {/* <NavItem>
            <Link className="nav-link" to="/">
              Home
            </Link>
          </NavItem>
          <Nav.Link path="/bout-us">About Us</Nav.Link>
          <Nav.Link href="/vision">Our Vision</Nav.Link>
          <Nav.Link href="/login">Login</Nav.Link> */}
        </Navbar>
      </div>
      <div>
        <Switch>
          <Route exact path="/about-us" component={AboutUs} />
          <Route exact path="/our-vision" component={OurVision} />
          <Route exact path="/login" component={Login} />
          <Route exact path="/" component={Home} />
          <Route
            render={function () {
              return <p>Not found</p>;
            }}
          />
        </Switch>
      </div>
    </div>
  );
};

export default App;
